/**
 * 喜报、悲报插件
 * 样例: #xb 服务器炸咯！
 * 效果图: https://gitee.com/bling_yshs/yunzaiv3-ys-plugin#%E5%96%9C%E6%8A%A5
 *
 * 样例2: #悲报 服务器炸咯！
 * 样例3: #bb 服务器炸咯！
 *
 * 支持换行：例如：
 *
 * #喜报 这是第一行
 * 这是第二行
 *
 * ↑像这样直接在QQ里发送就行，程序会自动处理
 */

import fs from "fs";
import plugin from "../../lib/plugins/plugin.js";
import { segment } from "oicq";
import puppeteer from "puppeteer";

//字体文件，可以自行替换
const fontFamily = "Microsoft YaHei";

//检测./data/xibao文件夹是否存在，不存在则创建
if (!fs.existsSync("./data/xibao")) {
  fs.mkdirSync("./data/xibao");
}

const xibaobase64Img = ``;

const beibaobase64Img = ``;

export class example extends plugin {
  constructor() {
    super({
      name: "喜报",
      dsc: "简单开发示例",
      event: "message",
      priority: 5000,
      rule: [
        {
          reg: "^#?(喜报|xb|悲报|bb)",
          fnc: "xibao",
        },
      ],
    });
  }
  async xibao(e) {
    let isBeibao = false;
    let keyword = "";
    let ori = e.message[0].text;
    let ori2 = e.message[0].text;
    let msg = ori2.replace(/(\r|\n)/g, "<br/>");
    const xibaoPattern = /^#?(喜报|xb)\s*(.*)$/;
    const beibaoPattern = /^#?(悲报|bb)\s*(.*)$/;
    let match = msg.match(xibaoPattern);
    if (match) {
      keyword = match[2];
    } else {
      match = msg.match(beibaoPattern);
      if (match) {
        keyword = match[2];
        isBeibao = true;
      } else {
        ori = ori.replace(/\n/g, "\\n");
        ori = ori.replace(/\r/g, "\\r");
        e.reply(`字符串${ori}不符合格式，请将此截图并反馈给插件作者`);
        return;
      }
    }

    let xibaofontcolor = `red`;

    let beibaoFontColor = `#5b5b5b`;

    let beibaostyle = `text-shadow: -2px -2px 0 #979797, 0 -2px 0 #979797,
        1px -2px 0 #979797, 1px 0 0 #979797, 1px 1px 0 #979797,
        0 1px 0 #979797, -2px 1px 0 #979797, -2px 0 0 #979797, #525252 0.05em 0.05em 0.2em;`;

    let xibaostyle = `text-shadow: -2px -2px 0 yellow, 0 -2px 0 yellow,
        1px -2px 0 yellow, 1px 0 0 yellow, 1px 1px 0 yellow,
        0 1px 0 yellow, -2px 1px 0 yellow, -2px 0 0 yellow, #525252 0.05em 0.05em 0.2em;`;

    let fontcolor = xibaofontcolor;
    let style = xibaostyle;
    let whichImage = xibaobase64Img;

    if (isBeibao == true) {
      whichImage = beibaobase64Img;
      style = beibaostyle;
      fontcolor = beibaoFontColor;
    }

    const img = Buffer.from(whichImage, "base64");
    const browser = await puppeteer.launch({
      headless: true,
      args: ["--disable-gpu", "--disable-setuid-sandbox", "--no-sandbox", "--no-zygote"],
    });
    const page = await browser.newPage();
    await page.setContent(`
    <!DOCTYPE html>
    <html lang="zh_CN">
        <head>
            <meta charset="UTF-8" />
            <meta http-equiv="X-UA-Compatible" content="IE=edge" />
            <meta name="viewport" content="width=device-width, initial-scale=1.0" />
            <title>Document</title>
            <style type="text/css">
                body {
                    font-family: ${fontFamily};
                    background-image: url(data:image/png;base64,${img.toString("base64")});
                            background-repeat: no-repeat;
                            background-size: cover;
                    margin: 0;
                    padding: 0;
                    height: 100vh;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                }
                #text {
                    text-align: center;
                    color: ${fontcolor};
                    font-size: 50px;
                    font-weight: bolder;
                    ${style}
                }
            </style>
        </head>
        <body>
            <div id="text">${keyword}</div>
        </body>
    </html>

            `);

    await page.screenshot({ path: "./data/xibao/temp.png" });
    await browser.close();
    e.reply(segment.image("./data/xibao/temp.png"));
  }
}
